#include <stdio.h>
#include <stdlib.h>

int main(int argc, char *argv[])
{
unsigned char array[30000] = {0};
int b = 0;
int c;
int e[30000];
int eIndex = 0;
int d = 0;//
while (argv[1][d] != '\0')
{
switch (b)
{
case sizeof(argv[1]):
    *array = malloc(sizeof(array)*10);
    break;
}
switch (argv[1][d])
{
case '+':
    switch (array[b])
    {
    case 255:
        array[b] = 0;
        break;
    default:
        array[b]++;
        break;
    }
    break;
case '-':
    switch (array[b])
    {
    case 0:
        array[b] = 255;
        break;
    default:
        array[b]--;
        break;
    }
    break;
case '>':
    b += 1;
    break;
case '<':
    b -= 1;
    break;
case ',':
    array[b] = getchar();
    break;
case '.':
    putchar(array[b]);
    break;
case '[':
    e[eIndex] = b;
    c = d;
    eIndex++;
    break;
case ']':
    switch (array[e[eIndex - 1]])
    {
    case 0:
        eIndex--;
        break;
    default:
        d = c;
        break;
    }
    break;
    }
    d += 1;
}
return 0;
}